import React from 'react';
import { Nav, Navbar } from "react-bootstrap";
import { XLg } from "react-bootstrap-icons";
import nuub from "../assets/img/cropped-nuub_logo.png";

const AuthenticationNav = () => {
  return (
    <Navbar className="navbar navbar-light pt-4 ps-4" expand="lg" style={{position: "absolute"}}>
      <Navbar.Brand>
        <img src={nuub} width="246px" height="83px" alt="logo"/>
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="navbar-nav" />
            <Nav
              className="nav"
              style={{ fontSize: 24, fontWeight: "bold" }}
            >
              <Nav.Link href="/" className="me-4" style={{position: "relative", left: "95%"}}>
               <XLg size={45}></XLg>
              </Nav.Link>
              </Nav>
    </Navbar>

  )
}

export default AuthenticationNav;
